import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card 
      name={contacts[0].name}
      img={contacts[0].img}
      tel = {contacts[0].tel}
      email = {contacts[0]}
      />
      <Card 
      name="Jensen"
      img="data:image/jpeg;base64,"
      tel = "+123 456 789"
      email = "b@beyonce.com"
      />
      <Card 
      name="Bjergsen"
      img="data:image/jpeg;base64,"
      tel = "+123 456 789"
      email = "b@beyonce.com"
      />

    </div>
  );
}

export default App;
